import React, { Component } from "react";
import CardList from "./CardList";
import { robots } from "./robots";
import Buscador from "./Buscador";

class App extends Component {
  constructor() {
    super();
    this.state = {
      robots: robots,
      searchfield: "",
    };
  }
  render() {
    return (
      <div className="tc">
        <h1>Robots</h1>
        <Buscador />
        <CardList robots={robots} />
      </div>
    );
  }
}

export default App;
